import React, { Component } from "react";
import { observer } from "mobx-react";

const App = observer(
  class App extends Component {
    render() {
      let todos = this.props.store.todos.map((todo, index) => (
        <li key={index}>{todo}</li>
      ));
      return (
        <div className="App">
          <h1>{this.props.store.filter}</h1>
          <ul>{todos}</ul>
          <h1>{this.props.store.dummy}</h1>
        </div>
      );
    }
  }
);

export default App;
